import React, { Fragment } from 'react';
import Header from '../Header/Header';
import Footer from '../Footer/Footer';
import Routers from '../../routes/Routers';
function Layout(props) {
    return (
        <Fragment>
            <Header/>
            <div>
                <Routers/>
                <Footer/>
            </div>
        </Fragment>
    );
}

export default Layout;
